import React from 'react';
import Footer from '../components/Footer';
import Header from '../components/Header'; src/components/Header/Header.js

const InProgress = () => {
    return(
        <div>
			<Header height="15vh"/>
            <section class="project" id="project">
		        <div class="container">
			        <div class="project-content">
				        <h1>Media and Design Co-op</h1>
				    <div class="tags">
					    <p class="ptags">Graphic Design, Web Development</p><br/>
				    </div>
				        <p class="description">Co-oping at Brigham and Women's hospital for Spring 2020 and Summer 1 semester. Stay tuned for updates!</p>
                </div>
                    </div>
		    </section>
			<Footer/>
        </div>
    );
}

export default InProgress;
